import React from 'react';
import { List, ListItem, ListItemText, Button } from '@mui/material';

const UserContributions = ({ contributions, onLoadMore }) => (
  <>
    <List>
      {contributions.map((contribution, index) => (
        <ListItem key={index}>
          <ListItemText
            primary={`Repo: ${contribution.repo}`}
            secondary={`Commit: ${contribution.commit} on ${new Date(contribution.date).toLocaleString()}`}
          />
        </ListItem>
      ))}
    </List>
    <Button variant="contained" color="primary" onClick={onLoadMore}>
      Load More
    </Button>
  </>
);

export default UserContributions;
